import './App.css';
import { Route, BrowserRouter } from "react-router-dom";
import RegistroPonto from './RegistroPonto';
import Geolocalizacao from './Geolocalizacao';

function App() {
  return (
      <BrowserRouter>
           <Route component = { RegistroPonto }  path="" exact />
           <Route component = { Geolocalizacao }  path="/geolocalizacao" />
       </BrowserRouter>
  );
}

export default App;
